            142 => ['CEDULA' => '64747718', 'NOMBRES' => 'YARLENIS', 'APELLIDOS' => 'ZAPATA BOHORQUEZ', 'CORREO' => 'yarlenis.zapata@archivogeneral.gov.co', 'CARGO' => 'PROFESIONAL UNIVERSITARIO', 'DEPENDECIAS' => 'SUBDIRECCION DE INSPECCION VIGILANCIA Y CONTROL', 'GRUPO' => 'SIN GRUPO', 'PERSONAS' => '', 'SEXO' => 'F', 'NOMBRAMIENTO' => 'P'],
            143 => ['CEDULA' => '24166743', 'NOMBRES' => 'MARIA ELVIRA', 'APELLIDOS' => 'ZEA CABRERA', 'CORREO' => 'maria.zea@archivogeneral.gov.co', 'CARGO' => 'PROFESIONAL ESPECIALIZADO', 'DEPENDECIAS' => 'SUBDIRECCION DE GESTION DEL PATRIMONIO', 'GRUPO' => 'GRUPO DE INVESTIGACION Y DIFUSION', 'PERSONAS' => 'X', 'SEXO' => 'F', 'NOMBRAMIENTO' => 'C-E'],
        ];

        $types_appointments = [
            'P-P' => 'Periódo de Prueba',
            'P' => 'Provisionalidad',
            'L-E' => 'Libre nombramiento y encargo',
            'L' => 'Libre nombramiento',
            'C' => 'Carrera administrativa',
            'C-E' => 'Carrera administrativa',
        ];

        foreach ($users AS $user) {
            $userMapped = [
                'type_document' => 'cc',
                'document_number' => $user['CEDULA'],
                'role_id' => Role::where('name', '=', 'user')->first()->id,
                'name' => $user['NOMBRES'] . ' ' . $user['APELLIDOS'],
                'email' => $user['CORREO'],
                'password' => bcrypt($user['CEDULA']),
            ];

            $newUser = User::create($userMapped);

            switch($user['SEXO']){
                case 'M':
                    $gender = 'male';
                    break;
                case 'F':
                    $gender = 'female';
                    break;
                default:
                    $gender = 'NS/NR';
                    break;
            }

            $personMapped = [
                'user_id' => $newUser->id,
                'position_id' => Position::where('title', $user['CARGO'])->first()->id,
                'dependency_id' => Dependency::where('name', $user['DEPENDECIAS'])->first()->id,
                'corporative_group_id' => CorporativeGroup::where('name', $user['GRUPO'])->first()->id,
                'type_appointment_id' => TypeAppointment::where('name', $types_appointments[$user['NOMBRAMIENTO']])->first()->id,
                'first_name' => $user['NOMBRES'],
                'last_name' => $user['APELLIDOS'],
                'with_people_charge' => $user['PERSONAS'] == 'X',
                'gender' => $gender,
            ];

            $person = Person::create($personMapped);
            $newUser->update(['person_id' => $person->id]);
        }
